from flask import render_template
app = Flask(__name__)
import base64
import random
import csv


ESC = 27


def segmentImage(pathToInput, pathToOutput):
    return pathToOutput

@app.route('/layoutLand', methods=['GET','POST'])
def layoutLand():
    # if we are initializing the page, just return the html
    if request.method == 'GET':
        return render_template("index.html")

    # if we have received an image name then save it
    imageName = request.form['imageNameInput']
    print("imageName: " + str(imageName))
    
    pathToInput = "./data/" + imageName
    pathToOutput = "./data/output/" + imageName
    print("pathToInput = " + pathToInput)
    print("pathToOutput = " + pathToOutput)

    if os.path.isfile(pathToInput):
        print("calling image segmenter")
        segmentedImagePath = segmentImage(pathToInput, pathToOutput)
                    
        with open(segmentedImagePath, "rb") as image_file:
            img = image_file.read()
            segmentedData = base64.b64encode(img)
            print ("encoded segmented image")
        with open(pathToInput, "rb") as image_file:
            img = image_file.read()
            inputData = base64.b64encode(img)
            print ("encoded input image")
    else:
        print("File not found!")
        return render_template("index.html")
    #print("segmentedData " + str(segmentedData))
    #print("\n\nsegmented decoded " + str(segmentedData.decode('utf8')))
    return render_template("index.html", text="temp text", segmentedData=segmentedData.decode('utf8'), inputData=inputData.decode('utf8'))
